function [C]=LpC_CCW_RotorModel_J040914(Jx,Jz,Mtip)
% LpC_CCW_RotorModel_J040914 - Propeller aerodynamics model for the L+C aircraft
%
% DESCRIPTION: 
%   This script contains the automatically generated propeller aerodynamics
%   model for L+C.
% 
% INPUTS:
%   List of column vectors containing the model explanatory variables 
%       The variables are in the following order:
%       [Jx,Jz,Mtip]
%
% OUTPUTS:
%   C - Matrix containing the model response variables in each column 
%       The variables are in the following order:
%       [C_Tx,C_Ty,C_Tz,C_Qx,C_Qy,C_Qz]
%
% WRITTEN BY:
%   Benjamin M. Simmons
%   Flight Dynamics Branch (D317)
%   NASA Langley Research Center
%
% HISTORY:
%   20 FEB 2021 - Created and debugged, BMS
%

% spline variable for tip Mach number
Mtip_0p3 = Mtip-0.3;
Mtip_0p3(Mtip_0p3<0) = 0;

% spline variable for Jz
Jz_0p2 = Jz-0.2;
Jz_0p2(Jz_0p2<0) = 0;

% initialize the output
C = zeros(1,6);

%Force and moment polynomials
C_Tx = ...
   +1.468025331590495E-01  .*                     1  + ... 
   -1.047428782702512E-01  .*                    Jx  + ... 
   +7.965812396761629E-02  .*                    Jz  + ... 
   -1.488834785361099E-01  .*                 Jz.^2  + ... 
   -1.526258474381517E-01  .*     Jz .* Mtip_0p3.^2  + ... 
   -2.144142218139758E-01  .*              Jx .* Jz  + ... 
   +3.330327072970288E-01  .*           Jx .* Jz.^2  + ... 
   +1.669368561728097E-01  .*                Jz_0p2  + ... 
   +2.164828542840951E-02  .*                 Jz.^3  + ... 
   -1.330817360826850E-01  .*  Jx .* Jz .* Mtip_0p3.^2  + ... 
   -6.120919446078687E-03  .*  Mtip_0p3 .* Jz_0p2.^3  + ... 
   -3.570576428055945E-01  .*          Jx .* Jz_0p2  + ... 
   -5.374865969197672E-02  .*           Jx .* Jz.^3  + ... 
   +6.854348590608577E-03  .*              Mtip_0p3  + ... 
   -1.162224572882008E-01  .*        Jx.^2 .* Jz.^2  + ... 
   -2.118093652146521E-01  .*                 Jx.^2  + ... 
   +3.632010735473220E-01  .*           Jx.^2 .* Jz ;      

C_Ty = zeros(size(Jx)); 

C_Tz = ...
   -2.298965856263280E-02  .*                    Jz  + ... 
   -3.894258631246416E-01  .*     Jz .* Mtip_0p3.^3  + ... 
   +2.503974238547664E-01  .*  Jx .* Jz .* Mtip_0p3.^2  + ... 
   +2.841497096854941E-03  .*                 Jz.^3  + ... 
   -7.181938737861267E-03  .*     Jz.^3 .* Mtip_0p3  + ... 
   +1.398390357128658E-02  .*        Jz .* Mtip_0p3  + ... 
   -1.410046524018437E-01  .*  Jx.^2 .* Jz .* Mtip_0p3  + ... 
   +3.839212119242863E-02  .*  Jx .* Jz .* Mtip_0p3 ;      

C_Qx = ...
   +1.045430918802704E-02  .*                     1  + ... 
   +3.592429540771470E-01  .*  Jz.^2 .* Mtip_0p3.^2  + ... 
   -4.329368054834152E-01  .*           Mtip_0p3.^4  + ... 
   -1.117662832625882E-01  .*     Jz.^2 .* Mtip_0p3  + ... 
   +6.678338552648375E-01  .*           Mtip_0p3.^3  + ... 
   +1.306573176821386E-01  .*     Jx .* Mtip_0p3.^3  + ... 
   +3.481050880406903E-02  .*     Jz.^3 .* Mtip_0p3  + ... 
   +6.032089437241136E-01  .*     Jz .* Mtip_0p3.^3  + ... 
   -3.575432656880349E-01  .*     Jz .* Mtip_0p3.^2  + ... 
   +8.699544286162707E-02  .*        Jz .* Mtip_0p3  + ... 
   -1.467390110044703E-01  .*           Mtip_0p3.^2  + ... 
   -5.280476267748680E-03  .*                    Jx  + ... 
   -2.241617297575048E-03  .*                 Jz.^4  + ... 
   +3.673721680985544E-03  .*                 Jz.^3  + ... 
   +6.037683379233425E-02  .*  Jx .* Jz .* Mtip_0p3.^2 ;      

C_Qy = ...
   +3.222852942764558E-02  .*                    Jz  + ... 
   -6.826676220368251E-02  .*              Jx .* Jz  + ... 
   -1.397843934137373E-03  .*                 Jz.^3  + ... 
   +6.507928217060512E-03  .*           Jx .* Jz.^3  + ... 
   +3.428994495606562E-01  .*           Jx.^3 .* Jz  + ... 
   +1.962805046642213E-02  .*           Jx.^2 .* Jz ;      

C_Qz = ...
   +2.827444735196227E-02  .*                    Jz  + ... 
   +2.395276353744833E-03  .*                 Jz.^3  + ... 
   -1.737254102033171E-02  .*              Jx .* Jz  + ... 
   +2.598992488506573E-03  .*           Jx .* Jz.^3  + ... 
   -1.773660455383638E-01  .*           Jx.^3 .* Jz  + ... 
   +1.647300208738315E-02  .*           Jx.^2 .* Jz ;      

% C_Qx and C_Qz are both negative for the CCW rotating rotor, as viewed
% from the top
C_Qx=-1*C_Qx;
C_Qz=-1*C_Qz;

% output the propeller force and moment coefficients
C = [C_Tx,C_Ty,C_Tz,C_Qx,C_Qy,C_Qz];

return
